import { PageRoutes } from "./types";
import products from "products";

export const pageRoutes: PageRoutes = {
	MAIN_PAGE: "/main",
	CATALOG: "/catalog",
	CONTACTS: "/contacts",
	DELIVERY: "/delivery",
	STORES: "/stores",
	CARD_PRODUCT: `/product/cardProduct/:vendorCode`,
	SHOPPING_CART: "/cart",
	PAYMENT: "/payment",
	NOT_FOUND: "/notFoundPage",
	FAVORITES: "/favorites",
	ERROR: "/error",
};

console.log(pageRoutes.CARD_PRODUCT, "pageRoutes");
